import React from 'react';
import './Footer.module.css';

const Footer = () => {
    return (
      <div className={footer-background}>
        charging electro car web-app created by Benjamin Tropper and Marlene Dirnberger from <a href="https://en.m.wikipedia.org/wiki/Graz"><b>GRAZ</b></a>
      </div>
    )
  }

  export default Footer;
